import {
	InputGroup,
	InputLeftAddon,
	Icon,
	Input,
	FormControl,
	FormHelperText,
	Stack,
	Button,
} from '@chakra-ui/react';
const LoginForm = () => {
	return (
		<form action="submit">
			<Stack spacing={3}>
				<Input />
				<Input />
				<Input />
				<Input />
			</Stack>

		</form>
	);
};

export default LoginForm;
